import React from 'react';
import './App.css';

function App() {
  return (
    <div style={style.wrapper} className="App">
      <div>
        <p>Hey mom</p>
      </div>
    </div>
  );
}

export default App;


const style = {
  wrapper : {
    backgroundColor : 'black',
    color: 'white',
    height: '100vh'
  }
}
